import { Route, Routes, Link, useHistory } from "react-router-dom";
import Home from "./Home.tsx";
import CreateTxn from "./CreateTxn.tsx";
import Button from "@mui/material/Button";

function Main() {
  return (
    <div className="content">
      <Button to="/" component={Link} variant="contained">
        Home
      </Button>
      <Button to="/create" component={CreateTxn} variant="contained">
        New Transaction
      </Button>

      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/create" element={<CreateTxn />} />
      </Routes>
    </div>
  );
}

export default Main;
